".ob-widget-btn {
  font-family: Verdana, Geneva, Sans-Serif;
  border: none;
  cursor: pointer;
  background-color: #337ab7;
  color: white;
  z-index: 2147483000!important;
  position: fixed!important;
  bottom: 20px;
  right: 20px;
  padding: 15px;
  text-align: center;
  border-radius: 30px!important;
  display: flex;
  align-items: center;
  justify-content: space-around;
  box-shadow: 0 1px 6px rgba(0,0,0,.06),0 2px 32px rgba(0,0,0,.16)!important;
  height: 60px;
  -webkit-transition: width 0.8s;
  transition: width 0.8s;
}

.ob-widget-btn:focus {
  outline:0;
}

.ob-widget-btn__icon {
  width: 24px;
  height: 24px;
  margin-right: 5px;
}

.ob-widget-btn__wide_text {
  font-size: 20px;
}

.ob-widget-btn__narrow_text {
  font-size: 10px;
}

.ob-widget-btn.wide .ob-widget-btn__narrow_text {
  display: none;
}
.ob-widget-btn.wide .ob-widget-btn__wide_text {
  display: inline;
}

.ob-widget-container-frame-container {
  height: 100%;
  width: 100%;
  -webkit-overflow-scrolling: touch!important;
  overflow: auto!important;
  overscroll-behavior: contain;
  background-color: white;
}

.ob-widget-container {
  width: 30%;
  height: 100%;
  z-index: 2147483001!important;
  position: fixed;
  top: 0;
  right: 0;
  transform: translateX(100%);
  -webkit-transform: translateX(100%);
  visibility: hidden;
  box-shadow: 0 1px 6px rgba(0,0,0,.06),0 2px 32px rgba(0,0,0,.16)!important;
}

@media only screen and (max-width: 767px) {
    .ob-widget-container {
        width: 100%;
    }

    .ob-widget-btn.wide.narrow .ob-widget-btn__wide_text {
      display: none;
    }

    .ob-widget-btn.wide.narrow {
      width: 60px;
      flex-direction: column;
      padding: 7px;
    }

    .ob-widget-btn.wide.narrow .ob-widget-btn__narrow_text {
      display: inline;
    }

    .ob-widget-btn.narrow .ob-widget-btn__icon {
      margin:auto;
    }
  }

  @media only screen and (min-width: 767px) {
    .ob-widget-container {
        width: 40%;
        min-width: 360px;
        max-width: 767px;
    }
  }

  @media only screen and (min-width: 1025px) {
    .ob-widget-container {
        width: 30%;
        min-width: 360px;
        max-width: 767px;
    }
  }

.ob-widget-container__header {
  position: absolute;
  width: 100%;
  height: 50px;
  z-index: 2147483005!important;
  top: 0;
  left: 0;
  background-color: #f8f8f8;
  border-color: #e7e7e7;
  border-width: 0 0 1px 0;
  border-style: solid;
  display: flex;
}

.ob-widget-container__header__back {
  flex-shrink: 0;
  width: 50px;
  display: flex;
  align-items: center;
}
.ob-widget-container__header__title {
  flex-grow: 1;
  align-items: center;
  display: flex;
}

.ob-widget-container__header__title__text {
  font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
  font-size: 18px;
  margin: auto;
  text-align: center;
  flex-grow: 1;
  color: #555;
}
.ob-widget-container__header__close {
  flex-shrink: 0;
  width: 50px;
  display: flex;
  align-items: center;
  display: flex;
}

.ob-widget-container__header__back__arrow {
  margin: auto;
  display: inline-block;
  height: 12px;
  position: relative;
  width: 12px;
  -moz-transform: rotate(135deg);
  -ms-transform: rotate(135deg);
  -webkit-transform: rotate(135deg);
  transform: rotate(135deg);
  cursor: pointer;
  opacity: 0.3;
  background: none;
  border: none;
  padding: 0;
  outline: inherit;
}

.ob-widget-container__header__back__arrow::before {
  bottom: 1px;
  content: '';
  height: 20px;
  position: absolute;
  right: 0;
  transform-origin: bottom;
  width: 2px;
  -moz-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  -webkit-transform: rotate(-45deg);
  transform: rotate(-45deg);
  background-color: #555;
}

.ob-widget-container__header__back__arrow:hover {
  opacity: 1;
}

.ob-widget-container__header__back__arrow::after {
  border-bottom-style: solid;
  border-bottom-width: 2px;
  border-right-style: solid;
  border-right-width: 2px;
  content: '';
  display: inline-block;
  height: 12px;
  left: 0;
  position: absolute;
  top: 0;
  width: 12px;
  color: #555;
}

.ob-widget-container__header__close__cross {
  position: relative;
  width: 24px;
  height: 24px;
  opacity: 0.3;
  background: none;
  border: none;
  padding: 0;
  cursor: pointer;
  outline: inherit;
  margin:auto;
}
.ob-widget-container__header__close__cross:hover {
  opacity: 1;
}
.ob-widget-container__header__close__cross:before, .ob-widget-container__header__close__cross:after {
  position: absolute;
  top:0;
  content: ' ';
  height: 24px;
  width: 2px;
  background-color: #555;
}
.ob-widget-container__header__close__cross:before {
  transform: rotate(45deg);
}
.ob-widget-container__header__close__cross:after {
  transform: rotate(-45deg);
}

.slide-in {
  animation: obwidget-slide-in 0.8s forwards;
  -webkit-animation: obwidget-slide-in 0.8s forwards;
}

.slide-out {
  animation: obwidget-slide-out 0.8s forwards;
  -webkit-animation: obwidget-slide-out 0.8s forwards;
}

@keyframes obwidget-slide-in {
  100% {
    transform: translateX(0%);
    visibility: visible;
  }
}

@-webkit-keyframes obwidget-slide-in {
  100% {
    -webkit-transform: translateX(0%);
    visibility: visible;
  }
}

@keyframes obwidget-slide-out {
  0% { transform: translateX(0%); visibility: visible;}
  100% { transform: translateX(100%); visibility: hidden;}
}

@-webkit-keyframes obwidget-slide-out {
  0% { -webkit-transform: translateX(0%); visibility: visible;}
  100% { -webkit-transform: translateX(100%); visibility: hidden;}
}
